import React from "react";


function Nav() {
  return (
    <nav className="navbar navbar-expand-sm bg-light">
        <ul class="navbar-nav row">
            <li class="nav-item col-md-4"><a class="nav-link" href="/">Clicky Game</a></li>
            <li class="nav-item col-md-4">Click an image to begin!</li>
            <li class="nav-item col-md-4">Scores go here!</li>

        </ul>
    </nav>
  );
}

export default Nav;
